  predict: function(features) {
    let predictions = [];
    for (let i = 0; i < this.n_estimators; i++) {
      predictions.push(this.predict_single_tree(features, i));
    }
    return predictions.reduce((sum, val) => sum + val, 0) / predictions.length;
  },

  predict_single_tree: function(features, tree_index) {
    const tree = this.trees[tree_index];
    let node_id = 0;
    while (!tree.nodes[node_id].is_leaf) {
      const node = tree.nodes[node_id];
      const value = features[node.feature];
      node_id = (value <= node.threshold) ? node.left_child : node.right_child;
    }
    return tree.values[node_id];
  }
